import React from "react";
import "./Projects.css";
import Aos from "aos";
import "aos/dist/aos.css";
import { useEffect } from "react";

const Projects = () => {
  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);
  let project = [
    {
      sNo: 1,
      image: "assets/gmail__clone.png",
      title: "Gmail Clone",
      link: "https://gmaail-clone-a-17.web.app/",
      description: "",
    },
    {
      sNo: 2,
      image: "assets/linkedin__clone.png",
      title: "Linkedin Clone",
      link: "https://linkedin-clone-ay-17.web.app/",
      description: "",
    },
    {
      sNo: 3,
      image: "assets/e__notebook.png",
      title: "e-Notebook",
      link: "https://e-notebook-by-abhishek.netlify.app/",
      description: "",
    },
    {
      sNo: 4,
      image: "assets/textEditoor.png",
      title: "TextEditooor",
      link: "https://texteditooor-by-abhishek.netlify.app/",
      description: "",
    },
    {
      sNo: 5,
      image: "assets/pixallery.png",
      title: "Pixallery - Image Gallery",
      link: "https://pixallery-by-abhishek.netlify.app/",
      description: "",
    },
  ];
  return (
    <>
      <section id="project-container">
        <h2>Projects</h2>
        <hr />
        <div className="row">
          {project.map((elem) => {
            const { title, description, link, image, sNo } = elem;
            return (
              <div className="col-lg-4" data-aos="zoom-in-right" key={sNo}>
                <div className="card d-flex">
                  <img src={image} className="card-img-top" alt="..." />
                  <div className="card-body">
                    <div className="d-flex">
                      <h5 className="card-title">{title}</h5>
                      <a href={link}>
                        <i className="fa-solid fa-link mx-2"></i>
                      </a>
                    </div>
                    <p className="card-text">{description}</p>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </section>
    </>
  );
};

export default Projects;
